('2066','18','7716','Villa Nacho Kurrat',Null,'Gepflegte, moderne Familienvilla in Santa Ponsa','26804','Diese charmante Villa mit Garten liegt in ruhiger Wohnlage in der Nähe von 3 Golfplätzen und des Santa Ponsa Country Club. In wenigen Minuten erreicht man den Yachthafen Port Adriano. Die Villa steht auf einem 958 m² großen Grundstück mit einer bebauten Fläche von 270 m², einschließlich einer 60 m² überdachten Terrasse, plus weiteren 103 m² freie Terrassen.\r\nZu den Vorzügen dieser Villa gehören: Klimaanlage warm/kalt, Heizung, Stellplätze für 3 Fahrzeuge, Pool von ebenen Rasenflächen umgeben. Des Weiteren können noch ca. 30 m² Kellerräume ausgebaut werden.','26805','960000','111','2013-07-09 15:03:41','106','2013-07-09 15:04:11',Null,'1915','121','915',1,'1','0',Null,Null,Null,'26806',Null,'0','0','0',Null,'2015-09-09 13:21:30',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'26807',Null,'26808',Null,'26809',Null,'26810',Null,'26811','0',0,'0');
